  \"2016-05-25T00:52:42.148259\",\n\t\"name\": \"flight-schedule-monitor\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Flight Schedule Monitor (FSM) is the
  main tool for the traffic management specialist at the FAA David J. Hurley Air Traffic
  Control System Command Center (ATCSCC) to monitor, model, and implement Ground Delay
  Program (GDP) operations.  FAA and airlines use FSM to monitor demand through receipt
  of FSM demand pictures of airports updated every 5 minutes.  FSM constructs  if
  scenarios for best options (i.e., best parameters) prior to making a GDP decision.
  \ Modeling may be used by: (1) the ARTCC Traffic Management Coordinator (TMC) to
  request ATCSCC implementation of a GDP in the event of significant congestion or
  if a demand imbalance is projected at an en route fix, route, or sector; (2) the
  ATCSCC to determine Air Route Traffic Control Center (ARTCC) start times, Airport
  Arrival Rate (AAR), and other parameters for a particular GDP scenario; and (3)
  the Airlines to see the effects of canceling or delaying a specific flights under
  a GDP.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
